import React from 'react';
import {connect} from "react-redux";
function Cart(cart) {
    return (
        <>
        {
            cart.map((cartObj)=>{
                return (
                    <li>{cartObj}</li>
                )
            })
        }
        </>
    )
}
const mapStateToProps = store  => {
    return store.cart;
}
export default Cart
